import React from 'react';
import { Link } from 'react-router-dom';
import { Box, List, ListItem, ListItemIcon, ListItemText, Paper } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import ChatIcon from '@mui/icons-material/Chat';
import EventIcon from '@mui/icons-material/Event';
import FavoriteIcon from '@mui/icons-material/Favorite';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';

const Sidebar = () => {
  return (
    <Paper elevation={3} sx={{ width: 240, flexShrink: 0, height: '100%', overflow: 'auto' }}>
      <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', p: 2 }}>
        <LocalHospitalIcon sx={{ mr: 1, color: 'primary.main' }} />
        <Box sx={{ fontWeight: 'bold', fontSize: '1.2rem' }}>HealthAI</Box>
      </Box>
      <List>
        {[
          { text: 'Home', icon: <HomeIcon />, path: '/' },
          { text: 'Chat', icon: <ChatIcon />, path: '/chat' },
          { text: 'Appointments', icon: <EventIcon />, path: '/appointments' },
          { text: 'Vitals', icon: <FavoriteIcon />, path: '/vitals' },
        ].map((item) => (
          <ListItem button key={item.text} component={Link} to={item.path}>
            <ListItemIcon>{item.icon}</ListItemIcon>
            <ListItemText primary={item.text} />
          </ListItem>
        ))}
      </List>
    </Paper>
  );
};

export default Sidebar;
